  return (
    <>
      {/* <Home /> */}
      {/* <Products /> */}
      {/* <Slide /> */}

      <BrowserRouter>
        <Switch>
          <Route exact path="/">
            <Home />
          </Route>

          <Route exact path="/">
            <Products />
          </Route>
        </Switch>
      </BrowserRouter>
    </>
  );
}

export default App;
